import React from "react";
import "./PhotoGrid.css";
import butterChickenImage from "./assessts/butterchicken.jpeg";
import chatImage from "./assessts/chat.jpeg";
import choleImage from "./assessts/chole.jpeg";
import dalImage from "./assessts/dal.jpeg";
import gulabImage from "./assessts/gulab.jpeg";
import lassiImage from "./assessts/lasi.jpeg";
import samosaImage from "./assessts/samosa.jpeg";
import tandoriImage from "./assessts/tandori.jpeg";
import biryaniImage from "./assessts/biryani.jpeg";
import naanImage from "./assessts/naan.png";
import paneerImage from "./assessts/pannerbutter.jpeg";

const photos = [
  {
    id: 1,
    src: butterChickenImage,
    alt: "Butter Chicken",
  },
  {
    id: 2,
    src: paneerImage,
    alt: "Paneer Tikka",
  },
  {
    id: 3,
    src: biryaniImage,
    alt: "Biryani",
  },
  {
    id: 4,
    src: dalImage,
    alt: "Dal Makhani",
  },
  {
    id: 5,
    src: samosaImage,
    alt: "Samosa",
  },
  {
    id: 6,
    src: choleImage,
    alt: "Chole",
  },
  {
    id: 7,
    src: chatImage,
    alt: "Chaat",
  },
  {
    id: 8,
    src: gulabImage,
    alt: "Gulab Jamun",
  },
  {
    id: 9,
    src: lassiImage,
    alt: "Lassi",
  },
  {
    id: 10,
    src: tandoriImage,
    alt: "Tandoori Chicken",
  },
  {
    id: 11,
    src: naanImage,
    alt: "Naan",
  },
  {
    id: 12,
    src: "https://images.pexels.com/photos/4245568/pexels-photo-4245568.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Pav Bhaji",
  },
];

const SectionTwo = () => {
  return (
    <div className="relative overflow-hidden my-10 px-4">
      <h2 className="text-3xl font-bold text-center mb-10 mt-10">
        {" "}
        {/* Added mt-10 for top margin */}
        Explore Our Culinary Delights
      </h2>
      <div className="flex animate-slide min-h-[250px] justify-center py-4">
        {photos.map((photo) => (
          <div
            key={photo.id}
            className="photo-card transform transition-transform duration-500 hover:scale-105 mx-4"
          >
            <img
              src={photo.src}
              alt={photo.alt}
              className="w-full h-full object-cover rounded-lg mb-3"
            />
            <div className="p-3">
              <h3 className="text-lg font-semibold">{photo.alt}</h3>
            </div>
          </div>
        ))}
        {/* Duplicate for infinite scroll effect */}
        {photos.map((photo) => (
          <div
            key={photo.id + 100} // Unique key
            className="photo-card transform transition-transform duration-500 hover:scale-105 mx-4"
          >
            <img
              src={photo.src}
              alt={photo.alt}
              className="w-full h-full object-cover rounded-lg mb-3"
            />
            <div className="p-3">
              <h3 className="text-lg font-semibold">{photo.alt}</h3>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SectionTwo;
